export class SoundServiceHelper {

    public static base64ToBuffer(mp3: string): ArrayBuffer {
        let binary = window.atob(mp3);
        let buffer = new ArrayBuffer(binary.length);
        let bytes = new Uint8Array(buffer);
        for (let i = 0; i < buffer.byteLength; i++) {
            bytes[i] = binary.charCodeAt(i) & 0xFF;
        }
        return buffer;
    }

    public static sampleMp3: string = "";
}
